import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles/MyVilla.css';

const MyVilla = () => {
  const [villas, setVillas] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchVillas = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/villa/my-villas', { withCredentials: true });
        setVillas(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching villas:', error);
        setLoading(false);
      }
    };

    fetchVillas();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="my-villa">
      <h2>My Villas</h2>
      {villas.length > 0 ? (
        <ul>
          {villas.map((villa) => (
            <li key={villa.id}>
              <h3>{villa.name}</h3>
              <p>{villa.address}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No villas found.</p>
      )}
    </div>
  );
};

export default MyVilla;
